import React from 'react';
import './App.css';
import HomePage from './pages/home'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p> Hello World</p>
      </header>
      <HomePage className='AppHome'></HomePage>   
    </div>
  );
}

export default App;
